Les Forces armées royales thaïlandaises (thaï : กองทัพไทย ; Kongthap Thai) sont les forces armées du royaume de Thaïlande. Elles comportent 3 branches : 
* l'Armée royale thaïlandaise (กองทัพบกไทย ; Kongthap Bok Thai) ; 
* la Marine royale thaïlandaise (กองทัพเรือ, ราชนาวี ; Kongthap Ruea) ; 
* la Force aérienne royale thaïlandaise (לกองทัพอากาศไทย ; Kongthab Akat Thai). Leur rôle principal est de protéger la souveraineté et l'intégrité territoriale du royaume de Thaïlande. Depuis 2004, elle est confrontée au terrorisme en raison du conflit dans le Sud de la Thaïlande.

